import React from 'react';

function Header() {
  const headerStyle = {
    backgroundColor: 'blue',
    color: 'white',
    padding: '20px',
    textAlign: 'center',
  };

  return (
    <header style={headerStyle}>
      <h1>Header Text</h1>
      <div>This is a block</div>
    </header>
  );
}

export default Header;
